script: |
  super -f text -I q693.spq | sort > q693.out

inputs:
  - name: q693.spq
    data: |
      SELECT DISTINCT cor0.col1 * cor0.col0 + + cor0.col1 / col2 + cor0.col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q693.out
    data: |
      104
      1053
      650
